import "./App.css";
import React from "react";

export default function App() {
  return (
    <div className="App">
      <Tests />
    </div>
  );
}

function Tests() {
  const tests = [
    {
      name: "Test1",
      sections: {
        section1: {
          name: "Section 1",
          topics: [
            {
              name: "Topic 1",
              linkToSlides: "placeholder_link",
              suggestedProblems: [1, 2, 3],
            },
            {
              name: "Topic 2",
              linkToSlides: "placeholder_link",
              suggestedProblems: [4, 5, 6],
            },
          ],
        },
        section2: {
          name: "Section 2",
          topics: [
            {
              name: "Topic 3",
              linkToSlides: "placeholder_link",
              suggestedProblems: [7, 8, 9],
            },
            {
              name: "Topic 4",
              linkToSlides: "placeholder_link",
              suggestedProblems: [10, 11, 12],
            },
          ],
        },
      },
    },
    {
      name: "Test2",
      sections: {
        section1: {
          name: "Section 1",
          topics: [
            {
              name: "Topic 1",
              linkToSlides: "placeholder_link",
              suggestedProblems: [13, 14, 15],
            },
            {
              name: "Topic 2",
              linkToSlides: "placeholder_link",
              suggestedProblems: [16, 17, 18],
            },
          ],
        },
        section2: {
          name: "Section 2",
          topics: [
            {
              name: "Topic 3",
              linkToSlides: "placeholder_link",
              suggestedProblems: [19, 20, 21],
            },
            {
              name: "Topic 4",
              linkToSlides: "placeholder_link",
              suggestedProblems: [22, 23, 24],
            },
          ],
        },
      },
    },
  ];
  return (
    <div className="logo">
      {tests.map((test) => {
        return <Test key={test.name} test={test} />;
      })}
    </div>
  );
}

function Test({ test }) {
  return (
    <div>
      <h1>{test.name}</h1>
      <Sections sections={Object.values(test.sections)} />
    </div>
  );
}

function Sections({ sections }) {
  return (
    <div>
      {sections.map((section) => (
        <Section key={section.name} section={section} />
      ))}
    </div>
  );
}

function Section({ section }) {
  return (
    <div>
      <h2>{section.name}</h2>
      <Topics topics={section.topics} />
    </div>
  );
}

function Topics({ topics }) {
  return (
    <div>
      {topics.map((topic) => (
        <div key={topic.name}>
          <h3>{topic.name}</h3>
          <a href={topic.linkToSlides}>Slides</a>
          <ul>
            {topic.suggestedProblems.map((problem) => (
              <li key={problem}>{problem}</li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
}
